<html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en-us" lang="en-us"><head><meta http-equiv="Content-Type" content="text/html; charset=utf-8"/><title>F.1.16 Buckling Modulus (EI)</title><link href="navigation.css" rel="stylesheet" type="text/css"/><link href="document.css" rel="stylesheet" type="text/css"/></head><body><p class="top_nav"><a href="part127.htm">&lt; Previous</a><span> | </span><a href="../FSAE_Rules_2021_V1.html">Contents</a><span> | </span><a href="part129.htm">Next &gt;</a></p><h4 style="padding-left: 5pt;text-indent: 0pt;text-align: left;"><a name="bookmark170">F.1.16 Buckling Modulus (EI)</a></h4><p style="padding-top: 4pt;padding-left: 50pt;text-indent: 0pt;text-align: left;">Equal to E*I, where E = modulus of Elasticity, and I = area moment of inertia about the weakest axis.</p><p class="nav">&nbsp;&nbsp;</p><p class="nav">&nbsp;</p><p class="nav"><a href="part127.htm">&lt; Previous</a><span> | </span><a href="../FSAE_Rules_2021_V1.html">Contents</a><span> | </span><a href="part129.htm">Next &gt;</a></p><p class="nav">&nbsp;&nbsp;</p></body></html>
